import React from 'react';
import styles from '../Header/Header.module.css';
import Typing from 'react-typing-animation';

const Header = (props) => (
    <>
    <div className="container">
        <div className={styles.bg} >
            <h1 className={styles.main}>Welcome to</h1>
            <Typing >
                <span loop={true} style={{color: "#fff"}}>Rooster Gring</span>
            </Typing>
            <button type="button" className="btn btn-light header-button">BUTTON BUTTON</button>
        </div>
    </div>

    </>
)

export default Header;
